import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component {
  state = {
      number : 10
    }
  render() {
    return (
      <div className="App">
        <header className="App">
          <h1> Savings & Coupons</h1>
          <div className="couponScreenBackground"> Hi </div>
        </header>
      </div>
    );
  }
}

export default App;
